import React, { useState } from 'react'
import Card from './Card';
import './App.css'
import Sdata from './Sdata';

const ncard = (val) => {
    if(val.title==="A Netflix Original Series"){
        return(
            <Card 
            title = {val.title}
            sname = {val.sname}
            imgsrc = {val.imgsrc}
            links = {val.links}
        />
        );
    }
}

const App = () => {
    return(
        <>
            <div className='cards'>
                <h1 className='heading_style'>List Of Top 5 Netflix Series In 2022</h1>
                { 
                    Sdata.map(ncard)
                }
            </div>
        </>
    );
}

export default App;
